import React from 'react';

const MobicareBanner = (props) => {
    return (
     
        <section class="w3l-services3">
        <div class="new-block3">
          <div class="container py-5">
            <div class="middle-section py-lg-5 py-4">
              <div class="section-width">
                <h3 class="hny-title two">MobiCare</h3>
              </div>
              <div class="link-list-menu">
           <h3 class="mb-sm-5 mb-4 text-justify " style={{color:'white'}}>Presenting the future of healthcare mobility solutions</h3>
                  <a class="btn btn-style btn-white" href="contact.html"> Get a Quote</a>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
};

export default MobicareBanner;
